import React from'react';
import { Link } from 'react-router-dom';
import styles from './Logo.module.css';
import logo from '../../Assets/Images/logo.png';

const Logo = () => (
    <div className={styles.Logo}>
        <Link to="/">
            <img src={logo} alt="logo" />
        </Link>
    </div>

)

export default Logo;
